public Object clone() {
  TernaryTree t = new TernaryTree();
  t.lo = (char[]) this.lo.clone();
  t.hi = (char[]) this.hi.clone();
  t.eq = (char[]) this.eq.clone();
  t.sc = (char[]) this.sc.clone();
  t.kv = (CharVector) this.kv.clone();
  t.root = this.root;
  t.freenode = this.freenode;
  t.length = this.length;

  return t;
}

